  twoDecimal,
  threeDecimal,
  fourDecimal,
  fiveDecimal,
  sixDecimal,
  sevenDecimal,
  eightDecimal,
  nineDecimal,
  tenDecimal,
}) => {

  let two = Number(twoDecimal);
