  let four = Number(fourDecimal);
  let five = Number(fiveDecimal);
  let six = Number(sixDecimal);
  let seven = Number(sevenDecimal);
  let eight = Number(eightDecimal);
  let nine  = Number(nineDecimal);
  let ten = Number(tenDecimal)

