    title: {
      text: "Carbon Emissions by electricity",
    },
    data: [
      {
        type: "column",
        dataPoints: [
          { label: "Natural Gas", y: two },
          { label: "Biomass", y: three },
          { label: "Coal", y: four },
          { label: "Geothermal", y: five },
          { label: "Hydro", y: six },
          { label: "Nuclear", y: seven },
          { label: "Petroleum", y: eight },
          { label: "Solarvoltaic", y: nine },
          { label: "Wind", y: ten },
        ],
      },
    ],
  };
  useEffect(() => {
    if(two === 'NaN') {
        Graph()
    }
})
  return (
    <div>
      <CanvasJSChart
        options={options}
        />
    </div>
  );
};



export default Graph;
